import React from "react";

function SidebarRow({ text, path }) {
  return (
    <div>
      <div className="sidebar-list">
        <span className="icon">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            height="24px"
            viewBox="0 0 24 24"
            width="24px"
            fill="#FFFFFF"
          >
            {path}
          </svg>
        </span>
        <span className="text">{text}</span>
      </div>
    </div>
  );
}

export default SidebarRow;
